Amount of units in hangar.

Also:
Scarab/Interceptor - pointer to next scarab/interceptor
Beacon - Flag spawn frame
Building - Tech type/upgrade type/larva timer/landing timer
Worker - Target resource CUnit pointer

```eps
// example: unlimit interceptor count from 8 to 20
// ONLY for P1 gantrithors

const P1gantrithors = UnitGroup(12);
const nonP1gantrithors = UnitGroup(12 * 7);
foreach(ptr, epd : EUDLoopNewUnit()) {
	epdswitch (epd + 25) {
	  case $U(&quot;Gantrithor&quot;):
	  	epdswitch (epd + 19, 255) {
	  	  case $P1:
	  	  	P1gantrithors.add(epd);
	  		break;
	  	  default:
	  		nonP1gantrithors.add(epd);
	  	}
		break;
	}
}
foreach(gantrithor : P1gantrithors.cploop) {
	foreach(dead : gantrithor.dying) {
	}
	var trainCount = 0;  // how many interceptors are being trained
	gantrithor.move_cp(0x98/4);  // buildQueue[[0, 1]]
	// [73] Interceptor
	Trigger(DeathsX(CurrentPlayer, Exactly, 73, 0, 0xFFFF), trainCount.AddNumber(1));
	Trigger(DeathsX(CurrentPlayer, Exactly, 73 &lt;&lt; 16, 0, 0xFFFF0000), trainCount.AddNumber(1));
	gantrithor.move_cp(0x9C/4);  // buildQueue[[2, 3]]
	Trigger(DeathsX(CurrentPlayer, Exactly, 73, 0, 0xFFFF), trainCount.AddNumber(1));
	Trigger(DeathsX(CurrentPlayer, Exactly, 73 &lt;&lt; 16, 0, 0xFFFF0000), trainCount.AddNumber(1));
	gantrithor.move_cp(0xA0/4);  // buildQueue[4]
	Trigger(DeathsX(CurrentPlayer, Exactly, 73, 0, 0xFFFF), trainCount.AddNumber(1));

	gantrithor.move_cp(0xC8/4);
	const inCount = bread_cp(0, 0);  // 0xC8: inHangerCount
	const outCount = bread_cp(0, 1);  // 0xC9: outHangerCount

	gantrithor.move_cp(0x94/4);  // currentButtonset
	if (trainCount + inCount + outCount &gt;= 20) {  // compare sum
		wwrite_cp(0, 0, $U(&quot;Protoss Carrier&quot;));
	} else {
		wwrite_cp(0, 0, $U(&quot;Gantrithor&quot;));
	}
}
foreach(gantrithor : nonP1gantrithors.cploop) {
	foreach(dead : gantrithor.dying) {
	}
	gantrithor.move_cp(0x94/4);  // currentButtonset
	wwrite_cp(0, 0, $U(&quot;Protoss Carrier&quot;));
}

```

The amount of HP that a unit currently has.

Value displayed in-game is divided by 256.  For example, a Marine that has 40 HP in-game would have 10240 or 0x2800 HP in memory.

Offset from unit index address: 0x08
Unit Index 0 HP = 0x0059CCA8 + 0x08 = 0x0059CCB0
Unit Index 1 HP = 0x00628298 + 0x08 = 0x006282A0
Unit Index 2 HP = 0x00628148 + 0x08 = 0x00628150

Example: Regenerate HP for unit at index 2 to a max of 100 HP

Unit Index 2 HP = 0x00628148 + 0x08 = 0x00628150

#### Trigger Examples:

```trig
Trigger(&quot;Player 1&quot;){
Conditions:
  // HP is less than 100
  MemoryAddr(0x628150, At most, 25599);

Actions:
  // Add 16/256 HP
  MemoryAddr(0x628150, Add, 16);
  Preserve Trigger();
}

//-----------------------------------------------------------------//

Trigger(&quot;Player 1&quot;){
Conditions:
  // HP is over 100
  MemoryAddr(0x628150, At least, 25601);

Actions:
  // Set to 100 HP
  MemoryAddr(0x628150, Set To, 25600);
  Preserve Trigger();
}
```

#### EPS Examples:
```eps
// Get hitpoints with epd unit address
const hp = dwread_epd(epd + 0x008 / 4) / 256;

// Set hitpoints with epd unit address
const value = 300;
SetMemoryEPD(epd + 0x008 / 4, SetTo, value * 256);

// Always keep HP for P1 units at 100
foreach(ptr, epd : EUDLoopPlayerUnit($P1)) {
  if (dwread_epd(epd + 0x008 / 4) / 256 &lt; 100) {
    SetMemoryEPD(epd + 0x008 / 4, SetTo, 100 * 256);
  }
}
```

