The pointer of the player&#039;s last created (alive) normal unit. Also the head of the singly linked list of the player&#039;s units.
If you wanna loop through a player&#039;s units, you should start from this pointer, then use CUnit.nextPlayerUnit as &#039;next&#039; pointer.
```eps
function loopPlayerUnit(player: TrgPlayer) {
    const FIRST_PLAYER_UNIT = EPD(0x6283F8);
    var ptr, epd = cunitepdread_epd(FIRST_PLAYER_UNIT + player);

    while (ptr &gt;= 1) {
        // place logic here (built-in function EUDLoopPlayerUnit(player) yields (ptr, epd) here)
        EUDSetContinuePoint();
        // CUnit+0x6C: nextPlayerUnit
        ptr, epd = cunitepdread_epd(epd + 0x6C/4);
    }
}
```
